INSERT INTO twill_blocks VALUES(17,1,'page',1,'{"heading":"Time No Limit","details":"At No Limits Martial Arts and Fitness, your schedule is our priority. Whether you''re dropping in for a single session or committing to a monthly membership, we\u2019ve got options to fit your life. Walk-ins are always welcome, and for those ready to take the leap, we offer discounts for monthly payments in advance. Ready when you are \u2014 let\u2019s remove the limits of time."}','dynamic-repeater-cards','cards',15,'default');
INSERT INTO twill_blocks VALUES(18,1,'page',2,'{"heading":"Location No Limit","details":"No Limits is closer than you think! Our main branch is conveniently located in Beaverdam, VA, and we\u2019re proud to have a satellite location at Reynolds Community College. Looking for something even closer? We\u2019re open to expanding into new neighborhoods, organizations, or businesses. If you\u2019d like to see No Limits in your area, let\u2019s talk \u2014 together, we can make it happen."}','dynamic-repeater-cards','cards',15,'default');
INSERT INTO twill_blocks VALUES(19,1,'page',3,'{"heading":"Ability No Limit","details":"At No Limits Martial Arts and Fitness, your starting point is just the beginning. From seasoned athletes seeking to refine their skills to beginners taking their first steps toward fitness, we\u2019re here to guide you. Our customized plans meet you where you are, building confidence, strength, and agility at your pace. Whatever your ability, we\u2019ll help you achieve your goals \u2014 no limits required."}','dynamic-repeater-cards','cards',15,'default');
